INSERT INTO `projects` (`id`, `title`, `description`, `image`, `image2`, `image3`, `image4`, `code`) VALUES
(1, 'Water Temperature Reducer from Thermoelectric Cooling System', 'This project aimed to design and construct a water temperature reducer using a thermoelectric cooling system. The device reduced water temperature from 32°C to 22°C under different water weights (200g, 300g, 400g) and airflow velocities (1.1, 1.4, and 1.7 m/s). The system achieved the highest efficiency at 400g and 1.7 m/s, improving performance by 50%.', , , , , '#define BLYNK_TEMPLATE_ID           \"TMPL6wl7-B0nY\"\r\n#define BLYNK_TEMPLATE_NAME         \"Quickstart Template\"\r\n#define BLYNK_AUTH_TOKEN            \"mhtdUA8olR_AoVk5sJFZpWeEdv698d7m\"\r\n\r\n#define BLYNK_PRINT Serial\r\n#include <PZEM004Tv30.h>\r\n#include <ESP8266WiFi.h>\r\n#include <BlynkSimpleEsp8266.h>\r\n#include <OneWire.h>\r\n#include <DallasTemperature.h>\r\n#include <LiquidCrystal_I2C.h>\r\n#include <TridentTD_LineNotify.h>\r\n#include <SoftwareSerial.h>\r\n#include <WiFiClientSecure.h>\r\n\r\nchar ssid[] = \"PTPM_2G\";\r\nchar pass[] = \"123321231\";\r\nString GAS_ID = \"AKfycbyrGylxzzGJ7QMrGDLIPduK-58dw9Sc94rubiqNSvQqYdYTyPVLBdscmMJ00Thu-U9N\"; \r\nconst char* host = \"script.google.com\";\r\n\r\n#define LINE_TOKEN \"kWyU5HPGNJroehA02bBalJFmb0lZJv4DhMsQhRniIoZ\" \r\n\r\nBlynkTimer timer;\r\n#define UPDATE_INTERVAL_HOUR   (0)\r\n#define UPDATE_INTERVAL_MIN    (0)\r\n#define UPDATE_INTERVAL_SEC    (30)\r\n\r\n#define UPDATE_INTERVAL_MS     (((UPDATE_INTERVAL_HOUR * 60 * 60) + (UPDATE_INTERVAL_MIN * 60) + UPDATE_INTERVAL_SEC) * 1000)\r\n#define BUZZER_PIN D0\r\n#define ONE_WIRE_BUS D3\r\n#define PZEM_RX_PIN D5\r\n#define PZEM_TX_PIN D6\r\n#define SWITCH_PIN D4\r\n#define LEDG_PIN D8\r\n#define LEDR_PIN D7\r\n\r\nOneWire oneWire(ONE_WIRE_BUS);\r\nDallasTemperature sensors(&oneWire);\r\nLiquidCrystal_I2C lcd(0x27, 20, 4);\r\nSoftwareSerial pzemSWSerial(PZEM_RX_PIN, PZEM_TX_PIN);\r\nPZEM004Tv30 pzem(pzemSWSerial);\r\n\r\nbool displayState = false; \r\nbool powerOutageNotified = false;\r\nbool powerRestoredNotified = false;  \r\nbool tempLowNotified[4] = {false, false, false, false};\r\nbool tempHighNotified[4] = {false, false, false, false};\r\n\r\nfloat temp1, temp2, temp3, temp4, voltage, current, power, energy;\r\n\r\n// Global timing variables\r\nunsigned long time_1000_ms_buf = 0;\r\nunsigned long time_sheet_update_buf = 0;\r\n\r\nvoid IRAM_ATTR toggleDisplay() {\r\n  displayState = !displayState; \r\n  lcd.clear();\r\n}\r\n\r\nvoid update_google_sheet() {\r\n    Serial.print(\"Connecting to \");\r\n    Serial.println(host);\r\n\r\n    WiFiClientSecure client;\r\n    const int httpPort = 443;\r\n\r\n    client.setInsecure();\r\n\r\n    if (!client.connect(host, httpPort)) {\r\n        Serial.println(\"Connection failed\");\r\n        return;\r\n    }\r\n\r\n    String url = \"/macros/s/\" + GAS_ID + \"/exec?temp1=\" + String(temp1) + \r\n                                       \"&temp2=\" + String(temp2) + \r\n                                       \"&temp3=\" + String(temp3) + \r\n                                       \"&temp4=\" + String(temp4) + \r\n                                       \"&voltage=\" + String(voltage) +\r\n                                       \"&current=\" + String(current) +\r\n                                       \"&power=\" + String(power) +\r\n                                       \"&energy=\" + String(energy);\r\n\r\n    client.print(String(\"GET \") + url + \" HTTP/1.1\\r\\n\" +\r\n                 \"Host: \" + host + \"\\r\\n\" +\r\n                 \"Connection: close\\r\\n\\r\\n\");\r\n\r\n    Serial.println(\"Closing connection\");\r\n}\r\n\r\nvoid setup() {\r\n  Serial.begin(115200); \r\n  Serial.println();\r\n  Serial.println(LINE.getVersion());\r\n  WiFi.begin(ssid, pass);\r\n  Serial.printf(\"WiFi connecting to %s\\n\", ssid);\r\n  while (WiFi.status() != WL_CONNECTED) {\r\n    Serial.print(\".\");\r\n    delay(400);\r\n  }\r\n  Serial.printf(\"\\nWiFi connected\\nIP : \");\r\n  Serial.println(WiFi.localIP());\r\n  \r\n  LINE.setToken(LINE_TOKEN);\r\n  lcd.begin();\r\n  lcd.backlight();\r\n  Blynk.begin(BLYNK_AUTH_TOKEN, ssid, pass);\r\n  sensors.begin();\r\n\r\n  lcd.setCursor(0, 1);\r\n  lcd.print(\" PROJECT TEMP\");\r\n  lcd.setCursor(7, 2);\r\n  lcd.print(\"By POMTER\");\r\n  delay(2000);\r\n  lcd.clear();\r\n  pinMode(LEDG_PIN, OUTPUT);\r\n  pinMode(LEDR_PIN, OUTPUT);\r\n  pinMode(BUZZER_PIN, OUTPUT);\r\n  timer.setInterval(1000L, myTimerEvent);\r\n  pinMode(SWITCH_PIN, INPUT_PULLUP);\r\n  attachInterrupt(digitalPinToInterrupt(SWITCH_PIN), toggleDisplay, FALLING);\r\n}\r\n\r\nvoid checkTemperature(float temp, int sensorIndex) {\r\n    if (!isnan(temp)) {\r\n        if (temp < 7.0 && !tempLowNotified[sensorIndex]) {\r\n            LINE.notify(\"⚠️ SENSOR\" + String(sensorIndex + 1) + \" ต่ำกว่า 7°C! ⚠️\");\r\n            tempLowNotified[sensorIndex] = true;\r\n            tempHighNotified[sensorIndex] = false; \r\n        } else if (temp > 9.0 && !tempHighNotified[sensorIndex]) {\r\n            LINE.notify(\"⚠️ SENSOR\" + String(sensorIndex + 1) + \" สูงกว่า 9°C! ⚠️\");\r\n            tempHighNotified[sensorIndex] = true;\r\n            tempLowNotified[sensorIndex] = false; \r\n        }\r\n    }\r\n}\r\n\r\nvoid myTimerEvent() {\r\n  sensors.requestTemperatures();\r\n\r\n  temp1 = sensors.getTempCByIndex(0);\r\n  temp2 = sensors.getTempCByIndex(1);\r\n  temp3 = sensors.getTempCByIndex(2);\r\n  temp4 = sensors.getTempCByIndex(3);\r\n\r\n  voltage = pzem.voltage();\r\n  current = pzem.current();\r\n  power = pzem.power();\r\n  energy = pzem.energy();\r\n\r\n  Blynk.virtualWrite(V1, String(temp1, 1));\r\n  Blynk.virtualWrite(V2, String(temp2, 1));\r\n  Blynk.virtualWrite(V3, String(temp3, 1));\r\n  Blynk.virtualWrite(V4, String(temp4, 1));\r\n\r\n  Blynk.virtualWrite(V5, String(voltage, 1));\r\n  Blynk.virtualWrite(V6, String(current, 2));\r\n  Blynk.virtualWrite(V7, String(power, 1));\r\n  Blynk.virtualWrite(V8, String(energy, 2));\r\n\r\n  lcd.clear();\r\n\r\n  if (!displayState) {\r\n    lcd.setCursor(0, 1);\r\n    lcd.print(\"VOLTAGE STATE: \");\r\n    \r\n    if (isnan(voltage)) {\r\n        lcd.print(\"OFF\");\r\n        lcd.setCursor(0, 2);\r\n        lcd.print(\"....POWER OUTAGE....\");\r\n        digitalWrite(LEDR_PIN, HIGH);\r\n        digitalWrite(BUZZER_PIN, LOW); \r\n        digitalWrite(LEDG_PIN, LOW);\r\n        if (!powerOutageNotified) {\r\n            LINE.notify(\"⚠️ ขณะนี้ไฟดับ กรุณาตรวจสอบ! ⚠️\");\r\n            powerOutageNotified = true;\r\n            powerRestoredNotified = false;\r\n        }\r\n    } else {\r\n        lcd.clear();\r\n        lcd.setCursor(0, 0);\r\n        lcd.print(\"VOLTAGE: \");\r\n        lcd.print(voltage, 1);\r\n        lcd.print(\" V\");\r\n        digitalWrite(LEDR_PIN, LOW);\r\n        digitalWrite(BUZZER_PIN, HIGH); \r\n        digitalWrite(LEDG_PIN, HIGH);\r\n        lcd.setCursor(0, 1);\r\n        lcd.print(\"CURRENT: \");\r\n        lcd.print(current, 2);\r\n        lcd.print(\" A\");\r\n\r\n        lcd.setCursor(0, 2);\r\n        lcd.print(\"POWER: \");\r\n        lcd.print(power, 1);\r\n        lcd.print(\" W\");\r\n\r\n        lcd.setCursor(0, 3);\r\n        lcd.print(\"ENERGY: \");\r\n        lcd.print(energy, 2);\r\n        lcd.print(\" kWh\");\r\n\r\n        if (!powerRestoredNotified) { \r\n            LINE.notify(\"⚠️ ไฟมาแล้ว!!⚠️\");\r\n            powerRestoredNotified = true;\r\n            powerOutageNotified = false;\r\n        }\r\n    }\r\n  } else {\r\n    lcd.setCursor(0, 0);\r\n    lcd.print(\"SENSOR1: \");\r\n    lcd.print(isnan(temp1) ? \"Error\" : String(temp1, 1));\r\n    lcd.print(\" C\");\r\n    digitalWrite(LEDR_PIN, LOW);\r\n    digitalWrite(BUZZER_PIN, HIGH);\r\n    digitalWrite(LEDG_PIN, HIGH);\r\n    \r\n    lcd.setCursor(0, 1);\r\n    lcd.print(\"SENSOR2: \");\r\n    lcd.print(isnan(temp2) ? \"Error\" : String(temp2, 1));\r\n    lcd.print(\" C\");\r\n\r\n    lcd.setCursor(0, 2);\r\n    lcd.print(\"SENSOR3: \");\r\n    lcd.print(isnan(temp3) ? \"Error\" : String(temp3, 1));\r\n    lcd.print(\" C\");\r\n\r\n    lcd.setCursor(0, 3);\r\n    lcd.print(\"SENSOR4: \");\r\n    lcd.print(isnan(temp4) ? \"Error\" : String(temp4, 1));\r\n    lcd.print(\" C\");\r\n  }\r\n\r\n  checkTemperature(temp1, 0);\r\n  checkTemperature(temp2, 1);\r\n  checkTemperature(temp3, 2);\r\n  checkTemperature(temp4, 3);\r\n  \r\n  Serial.println(\"======= Sensor Data =======\");\r\n  if (!displayState) {\r\n    Serial.printf(\"Voltage : %.1f V\\n\", isnan(voltage) ? 0.0 : voltage);\r\n    Serial.printf(\"Current : %.2f A\\n\", isnan(current) ? 0.00 : current);\r\n    Serial.printf(\"Power   : %.1f W\\n\", isnan(power) ? 0.0 : power);\r\n    Serial.printf(\"Energy  : %.3f kWh\\n\", isnan(energy) ? 0.000 : energy);\r\n    Serial.printf(\"SENSOR1 : %.1f C\\n\", isnan(temp1) ? 0.0 : temp1);\r\n    Serial.printf(\"SENSOR2 : %.1f C\\n\", isnan(temp2) ? 0.0 : temp2);\r\n    Serial.printf(\"SENSOR3 : %.1f C\\n\", isnan(temp3) ? 0.0 : temp3);\r\n    Serial.printf(\"SENSOR4 : %.1f C\\n\", isnan(temp4) ? 0.0 : temp4);\r\n  }\r\n  Serial.println(\"==========================\");\r\n}\r\n\r\nvoid loop() {\r\n    unsigned long time_ms = millis();\r\n    unsigned long time_dif = time_ms - time_1000_ms_buf;\r\n\r\n    // Read data every 1 sec\r\n    if (time_dif >= 1000) { // 1 sec\r\n        time_1000_ms_buf = time_ms;\r\n\r\n        sensors.requestTemperatures(); \r\n        temp1 = sensors.getTempCByIndex(0);\r\n        temp2 = sensors.getTempCByIndex(1);\r\n        temp3 = sensors.getTempCByIndex(2);\r\n        temp4 = sensors.getTempCByIndex(3);\r\n        \r\n        voltage = pzem.voltage();\r\n        current = pzem.current();\r\n        power = pzem.power();\r\n        energy = pzem.energy();\r\n\r\n        // Print DS18B20 temp\r\n        Serial.print(\"DS18B20 Temp: \" + String(temp1) + \" C\");\r\n\r\n        // Print PZEM004T data\r\n        Serial.print(\" Voltage: \" + String(voltage) + \" V\");\r\n        Serial.print(\"\\tCurrent: \" + String(current) + \" A\");\r\n        Serial.print(\"\\tPower: \" + String(power) + \" W\");\r\n        Serial.print(\"\\tEnergy: \" + String(energy) + \" Wh\");\r\n\r\n        digitalWrite(LED_BUILTIN, !digitalRead(LED_BUILTIN));\r\n    }\r\n\r\n    // Update Google Sheet at the specified interval\r\n    time_ms = millis();\r\n    time_dif = time_ms - time_sheet_update_buf;\r\n    if (time_dif >= UPDATE_INTERVAL_MS) {\r\n        time_sheet_update_buf = time_ms;\r\n        update_google_sheet();\r\n    }\r\n  \r\n    Blynk.run();\r\n    timer.run();\r\n}\r\n');
INSERT INTO `projects` (`id`, `title`, `description`, `image`, `image2`, `image3`, `image4`, `code`) VALUES
(2, 'Thermal Unit Commitment Optimization Using Gurobi with Startup, Reserve, and Operational Constraints', 'This project implements a Mixed-Integer Quadratic Programming (MIQP) model for solving the Thermal Unit Commitment (TUC) problem using Gurobi. It aims to minimize the total generation cost—including fuel cost and startup cost—while satisfying constraints such as power demand balance, spinning reserve requirements, minimum up/down times, and unit generation limits. The model supports a multi-hour planning horizon and reads generator and load data from Excel. Optimization results, including power dispatch, spinning reserve, and unit-wise fuel costs, are saved to an output Excel file.', , , , , '# Power.py\r\nimport gurobipy as gp\r\nfrom gurobipy import GRB\r\nimport pandas as pd\r\n\r\n# Load data from Excel\r\ndata_file = \"data.xlsx\"\r\ngenerators_df = pd.read_excel(data_file, sheet_name=\"Generators\")\r\ndemands_df = pd.read_excel(data_file, sheet_name=\"Demand\")\r\n\r\ngenerators = generators_df.to_dict(orient=\"records\")\r\ndemands = demands_df[\"Demand\"].tolist()\r\n\r\n# Index sets\r\nG = range(len(generators))   # Generator index\r\nT = range(len(demands))      # Time periods\r\n\r\n# Create Gurobi model\r\nmodel = gp.Model(\"Unit Commitment\")\r\n\r\n# Variables\r\nP = model.addVars(G, T, lb=0, name=\"Power\")                  # Power output\r\nu = model.addVars(G, T, vtype=GRB.BINARY, name=\"UnitOn\")     # ON/OFF status\r\nx = model.addVars(G, T, vtype=GRB.BINARY, name=\"Startup\")    # Startup\r\ny = model.addVars(G, T, vtype=GRB.BINARY, name=\"Shutdown\")   # Shutdown\r\n\r\n# Objective: Minimize total fuel cost\r\nmodel.setObjective(gp.quicksum(\r\n    generators[i][\"a\"] * u[i, t] +\r\n    generators[i][\"b\"] * P[i, t] +\r\n    generators[i][\"c\"] * P[i, t]**2\r\n    for i in G for t in T\r\n), GRB.MINIMIZE)\r\n\r\n# Constraints\r\nfor t in T:\r\n    # Meet demand\r\n    model.addConstr(gp.quicksum(P[i, t] for i in G) == demands[t], name=f\"Demand_{t}\")\r\n    \r\n    # Spinning reserve >= 110% of demand\r\n    model.addConstr(\r\n        gp.quicksum(u[i, t] * generators[i][\"Pmax\"] for i in G) >= 1.1 * demands[t],\r\n        name=f\"Reserve_{t}\"\r\n    )\r\n    \r\n    for i in G:\r\n        # Generation limits\r\n        model.addConstr(P[i, t] <= generators[i][\"Pmax\"] * u[i, t], name=f\"Pmax_{i}_{t}\")\r\n        model.addConstr(P[i, t] >= generators[i][\"Pmin\"] * u[i, t], name=f\"Pmin_{i}_{t}\")\r\n        \r\n        # Minimum up-time\r\n        MUT = generators[i][\"MUT\"]\r\n        if t + MUT - 1 < len(demands):\r\n            model.addConstr(\r\n                gp.quicksum(u[i, k] for k in range(t, t + MUT)) >= MUT * (u[i, t] - (u[i, t-1] if t > 0 else 0)),\r\n                name=f\"MUT_{i}_{t}\"\r\n            )\r\n\r\n        # Minimum down-time\r\n        MDT = generators[i][\"MDT\"]\r\n        if t + MDT - 1 < len(demands):\r\n            model.addConstr(\r\n                gp.quicksum(1 - u[i, k] for k in range(t, t + MDT)) >= MDT * ((u[i, t-1] if t > 0 else 0) - u[i, t]),\r\n                name=f\"MDT_{i}_{t}\"\r\n            )\r\n\r\n# Solve model\r\nmodel.optimize()\r\n\r\n# Export results\r\nif model.status == GRB.OPTIMAL:\r\n    power_output = pd.DataFrame(\r\n        [[P[i, t].X for i in G] for t in T],\r\n        columns=[f\"Unit {i+1}\" for i in G],\r\n        index=[f\"Hour {t+1}\" for t in T]\r\n    )\r\n    with pd.ExcelWriter(\"generator.xlsx\") as writer:\r\n        power_output.to_excel(writer, sheet_name=\"Power Output\")\r\n    print(\"Optimization complete. Results saved to generator.xlsx\")\r\nelse:\r\n    print(\" Optimization failed.\")\r\n');

